import React from 'react'
import logo from '../logo.svg';

function TweetElement() {
    return (
        <div className="tweet-container">
            <a className="profile-picture" href={URL}><img src={logo} alt="React-logo"/></a>
            <p className="tweet-body">This is the body.</p>
        </div>
    )
}

export default TweetElement
